import React from 'react';
import d from './Dialog.module.css';
import { NavLink } from 'react-router-dom';
// import Paf from '../paf';

const Dialogitem = (props) => {
  let path = '/dialog/' + props.id;
  return (
    <div className={d.dialog}>
      <NavLink path={path}>{props.name}</NavLink>
    </div>
  );
};

export default class Dialog extends React.Component {
  // state = {
  //   person: [{ name: 'Sasha', age: '34' }],
  // };

  render() {
    return (
      <div className={d.item}>
        <div className={d.dialogs}>
          <div className={d.dialog}>
            <NavLink to='/dialog/Tyom'>Tyom</NavLink>
          </div>
          <div className={d.dialog}>
            <NavLink to='/dialog/Viktoriya'>Viktoria</NavLink>
          </div>
          <div className={d.dialog}>
            <NavLink to='/dialog/Ash'>Ash</NavLink>
          </div>
          <div className={d.dialog}>
            <NavLink to='/dialog/Ann'>Ann</NavLink>
          </div>
          <div className={d.dialog}>
            <NavLink to='/dialog/Ani'>Ani</NavLink>
          </div>
        </div>
        <div className={d.message}>
          <div className={d.msg}>Hi</div>
          <div className={d.msg}>How is your komasutra?</div>
          <div className={d.msg}>Yo</div>
        </div>
      </div>
    );
  }
}
